import React from "react"
import './Plants.css'

function Plants(){

    return(
        <>
        <div className="plants-main">
            <a href="/annuals" className="plants-inner annuals">Annuals</a>
            <a href="/perennials" className="plants-inner perennials">Perennials</a>
            <a href="/fruits" className="plants-inner fruits">Fruits</a>
            <a href="/veggies" className="plants-inner veggies">Veggies</a>
        </div>
        </>
    );
}

export default Plants;
